			<div className="pageContainer">
				/*
				<svg width="100%" height="100%">
					<rect width="100%" height="60%"/>

				</svg>
				*/
				<div className="pageInfoDiv">
					<h1 className="pageHeader">
						{this.props.header}
					</h1>
					<p className="pageInfo">
						{this.props.information}
					</p>
				</div>
			</div>
		);
	}

}

export default AreaPage;
